function App() {
     const selectionState = atom({
          key: 'seclectionState',
          default: {},
     });

     return (
          <RecoilRoot>
               <div className='App'>
                    <div className='topBar'></div>
                    <div className='main'>
                         <div className='cart'></div>
                         {Menu({ database: db })}
                    </div>
               </div>
          </RecoilRoot>
     );
}

export default App;
